import React, {useEffect} from 'react'
import {fetchMostCommonZipcodes} from '../logic'

const CommonZipcodes = () => {
    useEffect(   () => {
        const data = fetchMostCommonZipcodes()
        if (data) {
            console.log(data)
        }
    }, [])
}

export default CommonZipcodes
